import "./App.css";
import Hotel from "./components/Hotel/Hotel";
import ItemHotel from "./components/Hotel/ItemHotel";

const App = () => {
  const dummy = [
    "Ciputra",
    "Tran Hung Dao, Hanoi, Vietnam",
    "80%",
    true,
    "double",
    "breakfast",
    "1000$",
    "4 days",
  ];

  return (
    <Hotel>
      <ItemHotel
        name={dummy[0]}
        location={dummy[1]}
        rate={dummy[2]}
        oceanview={dummy[3]}
        roomtype={dummy[4]}
        mealtype={dummy[5]}
        price={dummy[6]}
        days={dummy[7]}
      />
      <ItemHotel
        name={dummy[0]}
        location={dummy[1]}
        rate={dummy[2]}
        oceanview={dummy[3]}
        roomtype={dummy[4]}
        mealtype={dummy[5]}
        price={dummy[6]}
        days={dummy[7]}
      />
      <ItemHotel
        name={dummy[0]}
        location={dummy[1]}
        rate={dummy[2]}
        oceanview={dummy[3]}
        roomtype={dummy[4]}
        mealtype={dummy[5]}
        price={dummy[6]}
        days={dummy[7]}
      />
    </Hotel>
  );
};

export default App;

